import React from "react";
import Fullpage, {
  FullPageSections,
  FullpageNavigation,
  FullpageSection,
} from "@ap.cx/react-fullpage";

const HomeConts3 = () => {
  return (
    <FullpageSection>
      <div className="homeWrapper3">
        <div className="project1 box">
          pro1
        </div>
        <div className="project2 box">
        pro2
        </div>
        <div className="project3 box">
        pro3
        </div>
        <div className="project4 box">
        pro4
        </div>
      </div>
    </FullpageSection>
  );
};

export default HomeConts3;
